pragma solidity ^0.4.24;

import "./ExternalInterfaces/KydyUtilInterface.sol";
import "./ExternalInterfaces/GeneReleaseInterface.sol";
import "./KydyAccessControl.sol";
import "./KydyUtil.sol";

contract GeneSynthesis is KydyAccessControl {
    bool public isGeneSynthesis = true;
    uint256 traitBits_ = 20;
    uint256 codeBits_ = 5;
    uint256 traitsInGene_ = 12;

    KydyUtilInterface public kydyUtil_;
    GeneReleaseInterface public geneRelease_;

    constructor(address kydyUtilAddr, address geneReleaseAddr) public {
        ceoAddress = msg.sender;
        cooAddress = msg.sender;
        cfoAddress = msg.sender;
        kydyUtil_ = KydyUtilInterface(kydyUtilAddr);
        geneRelease_ = GeneReleaseInterface(geneReleaseAddr);
    }

    function setKydyUtilAddress(address newKydyUtil) public onlyCEO {
        KydyUtilInterface candidateContract = KydyUtilInterface(newKydyUtil);

        require(candidateContract.isKydyUtil());

        kydyUtil_ = candidateContract;
    }

    function setGeneReleaseAddress(address newGeneRelease) public onlyCEO {
        GeneReleaseInterface candidateContract = GeneReleaseInterface(newGeneRelease);

        require(candidateContract.isGeneRelease());

        geneRelease_ = candidateContract;
    }

    function isGeneSynthesis() public pure returns (bool) {
        return true;
    }

    event synthGeneResult(uint256 indexed gene1, uint256 indexed gene2, uint256 mixedGene);
    function synthGenes(uint256 gene1, uint256 gene2) public returns (uint256) {
        uint256 _mixedGene = 0;

        for (uint8 i = 0 ; i < traitsInGene_; i++) {
            uint256 _mixedTrait =
                mixTraits(
                    (gene1 >> (i * traitBits_)) & 0xfffff,
                    (gene2 >> (i * traitBits_)) & 0xfffff,
                    i
                );
            _mixedGene += _mixedTrait << (i * traitBits_);
        }

        emit synthGeneResult(gene1, gene2, _mixedGene);
        return _mixedGene;
    }

    uint256 public selectSeed_ = uint256(keccak256("SELECT"));

    function mixTraits(uint256 trait1, uint256 trait2, uint256 traitIndex) public returns (uint256) {
        uint256 _mixedTrait = 0;
        uint256[4] memory _mcode; // mother's trait to code array
        uint256[4] memory _fcode; // father's trait to code array

        for (uint8 i = 0 ; i < 4 ; i++) {
            _mcode[i] = (trait1 >> codeBits_ * (3 - i)) & 0x1f;
            _fcode[i] = (trait2 >> codeBits_ * (3 - i)) & 0x1f;
        }

        for (uint8 j = 3 ; j > 0 ; j--) { // gene swapping
            if(kydyUtil_.getRand(selectSeed_) % 100 < 25) {
                _mcode = swap(_mcode, j, j - 1);
            }
            if(kydyUtil_.getRand(selectSeed_) % 100 < 25) {
                _fcode = swap(_fcode, j, j - 1);
            }
        }

        for (uint8 k = 0 ; k < 4 ; k++) {
            _mixedTrait += mixCodes(_mcode[k], _fcode[k], traitIndex, k) << ((3 - k) * codeBits_);
        }

        return _mixedTrait;
    }

    function swap(uint256[4] trait, uint8 num1, uint8 num2) public pure returns (uint256[4]) {
        uint256 temp = 0;

        temp = trait[num1];
        trait[num1] = trait[num2];
        trait[num2] = temp;

        return trait;
    }

    function isMutable(uint256 code1, uint256 code2) public pure returns (bool) {
        if (code1 - code2 == 1 || code2 - code1 == 1) {
            if ((code1 + code2) % 4 == 1) return true;
        }
        return false;
    }

    function mixCodes(uint256 code1, uint256 code2, uint256 traitIndex, uint8 codeIndex) public returns (uint256) {
        if (codeIndex == 3) { // only active code can be mutated
            if (isMutable(code1, code2)) return mixCodesMutable(code1, code2, traitIndex);
            else return mixCodesNormal(code1, code2);
        }
        else return mixCodesNormal(code1, code2);
    }

    uint256 public mutateSeed_ = uint256(keccak256("MUTATE"));
    uint256 public mutationChance = 25; // percent

    function setMutationChance(uint256 percent) public onlyCEO {
        require(percent <= 100, "mutationChance value should be less than or equal to 100");
        mutationChance = percent;
    }

    function mixCodesMutable(uint256 code1, uint256 code2, uint256 traitIndex) public returns (uint256) {
        uint256 result;
        uint256 mutProbability = 0;

        if (code1 <= 13 || code2 <= 13) { // mutation probability will be 0.25 -> total 14%
            mutProbability = mutationChance;
        }
        else if (code1 > 13 || code2 > 13) { // mutation probability will be 0.25 * 0.75 -> total 10.5%
            mutProbability = (mutationChance * 3) / 4;
        }
        else if (code1 > 23 || code2 > 23) { // mutation probability will be 0.25 * 0.50 -> total 7%
            mutProbability = mutationChance / 2;
        }

        if (mutProbability > 0) {
            if (kydyUtil_.getRand(mutateSeed_) % 100 < mutProbability) {
                if (code1 % 2 == 1) result = (code1 >> 1) + 0x10;
                else result = (code2 >> 1) + 0x10;

                if (geneRelease_.isCodeReleased(traitIndex, result)) return result;
                else return mixCodesNormal(code1, code2);
            } else {
                return mixCodesNormal(code1, code2);
            }
        }
    }

    uint256 public normalSeed_ = uint256(keccak256("NORMAL"));

    function mixCodesNormal(uint256 code1, uint256 code2) public returns (uint256) {
        if (kydyUtil_.getRand(normalSeed_) % 100 < 50) return code1;
        else return code2;
    }
}
